uint16_t get_heat_sensor_data(uint16_t frame_buffer[64], volatile uint16_t frame_number)
{ 
    #if AVRORA
    memcpy_P(frame_buffer, &heat_sensor_data[frame_number], sizeof(uint16_t[64]));
    #else
    memcpy(frame_buffer, &heat_sensor_data[frame_number], sizeof(uint16_t[64]));
    #endif
    return frame_number; // This is just here to make sure avr-gcc doesn't optimise the call to memcpy_P to be a jmp, because that messes up output processing.
                         // The slowdown because of this hack is less than a few thousand cycles, on a benchmark of 12 million.
}
